  true,\n\t\"url\": null,\n\t\"notes\": \"The National Renewable Energy Laboratory
  (NREL) Gearbox Reliability Collaborative (GRC) was established by the U.S. Department
  of Energy in 2006; its key goal is to understand the root causes of premature gearbox
  failures and improve their reliability. The GRC uses a combined gearbox testing,
  modeling, and analysis approach disseminating data and results to the industry and
  facilitating improvement of gearbox reliability. This test data describes the tests
  of GRC gearbox 2 in the National Wind Technology Center dynamometer and documents
  any modifications to the original test plan. It serves as a guide to interpret the
  publicly released data sets with brief analyses to illustrate the data. TDMS viewer
  and Solidworks software required to view data files.n\",\n\t\"license_title\": \"Creative
